import { useEffect } from 'react';
import { GoogleLogout, GoogleLogin } from 'react-google-login';

const Header = (props) => {

    const user = null;

    const failure = (error) => {
        console.log(error);
        console.log("lol");
    }

    const successIn = async (res) => {
        console.log("logged in");
        console.log(res);
    }

    const successOut = async (res) => {
        console.log(res);
    }

    return (
    <div className="m-10 flex place-content-between">
        <div className="flex font-bold text-4xl text-[#F4D47E]">
            SPEED TYPER V2
        </div>
        <div className="flex bg-[#F4D47E] rounded-xl px-4 text-center">
            <div className="flex flex-col justify-center">
                {user ? (
                    <div className="flex place-content-evenly">
                        <div className="flex flex-col place-content-evenly">
                        <div>
                            {user.email}
                        </div>
                        <div>
                            {user.wpm}
                        </div>
                        </div>
                        <GoogleLogout 
                        clientId='615805703985-8sj5reb1j7sc7vdi648huunoqesvrsla.apps.googleusercontent.com'
                        onLogoutSuccess={successOut}
                        />
                    </div>
                ) : (
                    <div>
                        <GoogleLogin 
                        clientId="615805703985-8sj5reb1j7sc7vdi648huunoqesvrsla.apps.googleusercontent.com"
                        onSuccess={successIn}
                        />
                    </div>
                )}
            </div>
        </div>
    </div>
    )
}    

export default Header;
